import styled from "styled-components";

export default function Experience({ language }) {
    return (
        <Container>
            {!language ? <>
                <h1>Experiências</h1>
                <div>
                    <div>
                        <img src="/assets/poli.png" alt="Logo Poli"/>
                        <h1>Diretor Acadêmico do Centro Acadêmico do Centro Acadêmico da Engenharia Elétrica e da USP (CEE)</h1>
                        <h2>Organização de Eventos</h2>
                        <h3>- Protecs</h3>
                        <h3>- SEnEC</h3>
                        <h3>Divulgação de eventos e Informações</h3>
                        <h3>Representação dos interesses dos alunos diante o corpo acadêmico da faculdade</h3>

                    </div>
                    <div>
                        <img src="/assets/driven.png" alt="Logo Driven" />

                        <h1>Driven Education</h1>

                    </div>
                </div>
            </> :
                <>
                    <h1>Experience</h1>
                </>
            }
        </Container>
    );
}

const Container = styled.div`
    height: 85vh;
    margin-top: 5%;
    padding-left: 5%;
    padding-right: 5%;
    display: flex;
    flex-direction: column;
    background-color: #555555;;

    div {
        padding-top: 3%;
        display: flex;
        flex-direction: row;
        justify-content: space-around;
        div{
            flex-direction: column;
        }
    }

    h1{
        padding-top: 10vh;
        font-size: 40px;
        font-weight: 700;
        font-family: 'Times New Roman', Times, serif;
        color: white;
    }

    h2 {
        padding-top: 9px;
        font-size: 16px;
        font-weight: 400;
        font-family: 'Times New Roman', Times, serif;
        color: white;
    }

    h3 {
        padding-top: 4px;
        padding-left: 10px;
        font-size: 14px;
        font-weight: 400;
        font-family: 'Times New Roman', Times, serif;
        color: white;
    }

    h4 {
        padding-top: 14px;
        font-size: 20px;
        font-weight: 400;
        font-family: 'Times New Roman', Times, serif;
        color: white;
    }

    h5 {
        padding-top: 4px;
        padding-left: 10px;
        padding-bottom: 5vw;
        font-size: 14px;
        font-weight: 400;
        font-family: 'Times New Roman', Times, serif;
        color: white;
    }

    img {
        width: 15vw;
        height: 15vw;
    }
`
